use std::{
    convert::TryInto,
    str::FromStr,
    time::{SystemTime, UNIX_EPOCH},
};

use keccak::f1600;

use crate::U256 as u256;

pub(crate) fn generate_seed() -> u256 {
    let mut state: [u64; 25] = [0; 25];

    let mut i = 0;
    while i < state.len() {
        state[i] = SystemTime::now()
            .duration_since(UNIX_EPOCH)
            .unwrap()
            .as_nanos()
            .try_into()
            .unwrap();
        i += 1;
    }

    f1600(&mut state);

    let mut result = u256::zero();

    result.0[0] = state[0];
    result.0[1] = state[1];
    result.0[2] = state[2];
    result.0[3] = state[3];

    result
}

